import React from "react";
import Blog from './blog.jsx';
import Cont from './Content.jsx';

function App(){
    return(
    <div className="main">
        {Cont.map((value, index) => {
           
        return(
            <Blog
                key={index}
                img={value.img}
                content={value.content}
                title={value.title}
            />
        );
        })}

    </div>
    );
}

export default App;
